import React from 'react';
import './SearchResults.css';

export const SearchResults = ({ results, loading, selectedItem, onSelectItem }) => {
  if (loading) {
    return (
      <div className="search-results-container loading">
        <div className="loading-spinner"></div>
        <p>Loading results...</p>
      </div>
    );
  }

  if (!results || results.length === 0) {
    return (
      <div className="search-results-container empty">
        <div className="empty-state">
          <svg width="64" height="64" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M10 3H14C14.5304 3 15.0391 3.21071 15.4142 3.58579C15.7893 3.96086 16 4.46957 16 5V19C16 19.5304 15.7893 20.0391 15.4142 20.4142C15.0391 20.7893 14.5304 21 14 21H10C9.46957 21 8.96086 20.7893 8.58579 20.4142C8.21071 20.0391 8 19.5304 8 19V5C8 4.46957 8.21071 3.96086 8.58579 3.58579C8.96086 3.21071 9.46957 3 10 3Z" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            <path d="M8 7H6C5.46957 7 4.96086 7.21071 4.58579 7.58579C4.21071 7.96086 4 8.46957 4 9V15C4 15.5304 4.21071 16.0391 4.58579 16.4142C4.96086 16.7893 5.46957 17 6 17H8" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            <path d="M16 7H18C18.5304 7 19.0391 7.21071 19.4142 7.58579C19.7893 7.96086 20 8.46957 20 9V15C20 15.5304 19.7893 16.0391 19.4142 16.4142C19.0391 16.7893 18.5304 17 18 17H16" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
          </svg>
          <h3>No results found</h3>
          <p>Try adjusting your search terms or filters</p>
        </div>
      </div>
    );
  }

  return (
    <div className="search-results-container">
      <div className="search-results">
        {results.map((item) => (
          <div
            key={item.ItemNum}
            className={`result-item ${selectedItem && selectedItem.ItemNum === item.ItemNum ? 'selected' : ''}`}
            onClick={() => onSelectItem(item)}
          >
            <div className="result-header">
              <div className="item-number">
                Item {item.ItemNum}
                {item.ItemNumAlias && <span className="item-alias"> ({item.ItemNumAlias})</span>}
              </div>
              <div className="item-fee">
                ${item.ScheduleFee ? parseFloat(item.ScheduleFee).toFixed(2) : '0.00'}
              </div>
            </div>

            <div className="item-description">
              {item.HumanReadableDescription || item.Description}
            </div>

            <div className="item-metadata">
              {item.CategoryDescription && (
                <div className="metadata-item">
                  <span className="metadata-label">Category:</span>
                  <span className="metadata-value">{item.CategoryDescription}</span>
                </div>
              )}

              {(item.GroupDescription || item.Group) && (
                <div className="metadata-item">
                  <span className="metadata-label">Group:</span>
                  <span className="metadata-value">{item.GroupDescription || item.Group}</span>
                </div>
              )}

              {item.ItemType && (
                <div className="metadata-item">
                  <span className="metadata-label">Type:</span>
                  <span className="metadata-value">{item.ItemType}</span>
                </div>
              )}

              {item.FeeType && (
                <div className="metadata-item">
                  <span className="metadata-label">Fee Type:</span>
                  <span className="metadata-value">{item.FeeType}</span>
                </div>
              )}
            </div>

            {item.NewItem === 'Y' && (
              <div className="item-tag new">New</div>
            )}

            <div className="item-view-details">
              <span>View details</span>
              <svg width="16" height="16" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M9 18L15 12L9 6" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
              </svg>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};
